import React from "react";

const ProductDetails = ({data, handler}) => {
  return (
    <div>
      <TextField
        id="filled-multiline-flexible"
        label="Product description"
        name="description"
        multiline
        maxRows={4}
        variant="filled"
        onChange={(e)=> handler({...data,[e.target.name]:e.target.value})}
      />
     <TextField
